import React from "react";
import "../styles/login.css";
import "../styles/inputField/inputField1.css";
import logo from "../assets/logo.svg";
import { Formik } from "formik";
import * as yup from "yup";
import { useNavigate } from "react-router-dom";
import { useDispatch } from "react-redux";
import { setLogin } from "../state";
import axios from "axios";
import { ToastContainer, toast } from "react-toastify";
import "react-toastify/dist/ReactToastify.css";

const initialValues = {
  email: "",
  password: "",
};

//VALIDATION SCHEMA
const loginSchema = yup.object().shape({
  email: yup.string().email().required("Email Required"),
  password: yup.string().min(4).required("Password Required"),
});

function LogIn() {
  const dispatch = useDispatch();
  const navigate = useNavigate();
  const notify = (message) =>
    toast.error(message, {
      position: "top-right",
      autoClose: 5000,
      hideProgressBar: false,
      closeOnClick: true,
      pauseOnHover: false,
      draggable: true,
      progress: undefined,
      theme: "dark",
    });

  const handleFormSubmit = async (values, onSubmitProps) => {
    try {
      const res = await fetch("http://localhost:3001/auth/login", {
        method: "POST",
        headers: {
          "Content-Type": "application/json",
          "Access-Control-Allow-Origin": "*",
        },
        body: JSON.stringify(values),
      });
      if (res.ok) {
        console.log(res.token);

        // dispatch(
        //   setLogin({
        //     token: res.data.token,
        //     user: res.data.user,
        //   })
        // );
      }
    } catch (e) {
      console.log(e);
    }
    // try {
    //   const res = await fetch("http://localhost:3001/auth/login", {
    //     method: "POST",
    //     headers: {
    //       "Content-Type": "application/json",
    //       "Access-Control-Allow-Origin": "*",
    //     },
    //     body: JSON.stringify(values),
    //   });
    //   if (res.ok) {
    //     dispatch(
    //       setLogin({
    //         token: res.data.token,
    //         user: res.data.user,
    //       })
    //     );
    //     navigate("/homepage");
    //   } else if (res.status === 400) {
    //     console.log(res);
    //     console.log(res.status);
    //     notify("Email does not exist.");
    //   } else if (res.status === 401) {
    //     console.log(res);
    //     notify("wrong password.");
    //   }
    // } catch (e) {
    //   console.log(e);
    //   notify("server error. Please try again later.");
    // }

    // axios
    //   .post("http://localhost:3001/auth/login", values)
    //   .then((res) => {
    //     onSubmitProps.resetForm();
    //     dispatch(
    //       setLogin({
    //         token: res.data.token,
    //         user: res.data.user,
    //       })
    //     );
    //     navigate("/homepage");
    //   })
    //   .catch((err) => {
    //     notify("wrong Email or password.");

    //     console.log(err);
    //   });
  };

  return (
    <>
      <div className="mainbg">
        <ToastContainer />;
        <div className="left">
          <div className="logo">
            <img src={logo} alt="" />
          </div>
          <div className="form-section">
            <div className="welcometext">WELCOME BACK</div>
            <Formik
              initialValues={initialValues}
              validationSchema={loginSchema}
              onSubmit={handleFormSubmit}
            >
              {({
                values,
                errors,
                touched,
                handleBlur,
                handleSubmit,
                handleChange,
              }) => (
                <form onSubmit={handleSubmit}>
                  <div className="start-align">
                    <input
                      type="text"
                      placeholder="Email"
                      name="email"
                      value={values.email}
                      onChange={handleChange}
                      onBlur={handleBlur}
                    />
                    {errors.email && touched.email ? (
                      <p className="form-error">{errors.email} </p>
                    ) : null}
                    <input
                      type="password"
                      autoComplete="off"
                      placeholder="Password"
                      name="password"
                      value={values.password}
                      onChange={handleChange}
                      onBlur={handleBlur}
                    />
                    <span>
                      {errors.password && touched.password ? (
                        <p className="form-error">{errors.password} </p>
                      ) : (
                        <p></p>
                      )}
                      <p>
                        <a className="forgetPassword" href="">
                          Forget Password
                        </a>{" "}
                      </p>
                    </span>
                  </div>
                  <button type="submit">Submit</button>
                </form>
              )}
            </Formik>

            <p>
              Don't have an account? <a href="/signup">SignUp</a>
            </p>
          </div>
        </div>
        <div className="right">
          <p>Where Comfort Meets Convenience:</p>
          <p>Explore Your Dream Residence Today</p>
        </div>
      </div>
    </>
  );
}

export default LogIn;
